import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import { Navbar, Nav, Container, Row, Col, Form, Button  } from 'react-bootstrap';


function App() {
  return (
    <>
      <Navbar bg="white" data-bs-theme="light">
        <Container>
          <Navbar.Brand href="#home">
            <img
              alt="Brand Logo"
              src="images/SkinShots-Logo.png"
              width="80"
              height="80"
              className="d-inline-block align-top"
            />{' '}
            <img
              alt="Brand Logo"
              src="images/SkinShots-Name.png"
              width="90"
              height="20"
              className="d-inline-block align-top"
            />{' '}

          </Navbar.Brand>
        </Container>
      </Navbar>

    </>
  );
}

export default App;
